import useSWR from 'swr';
import React from 'react';
import Cookies from 'universal-cookie';

const SummonerPage = () => {
  const [accountId, setAccountId] = React.useState(null);
  const cookies = new Cookies();

  const { data, error } = useSWR(
    `https://br1.api.riotgames.com/lol/match/v4/matchlists/by-account/${localStorage.getItem(
      `accountId`
    )}?api_key=RGAPI-010fd2a0-a370-44eb-acc2-93947b3a2516`
  );

  React.useEffect(() => {
    cookies.get('accountId');
  }, []);

  if (!data) {
    return <p>loading</p>;
  }

  console.log(data);

